import { Box, Typography } from "@mui/material";
import { Link } from "@mui/material";
function Etusivu() {
  return (
  <Box
    sx={{
      bgcolor: "background.paper",
      pt: 8,
      pb: 6,
      m: 5,
      typography: "h6"
    }}
  >
          <Typography
          component="h1"
          variant="h2"
          align="left"
          gutterBottom>
            Kysely 1
          </Typography>
          <Link href="#" color="black">
            {"Linkki ensimmäiseen kyselyyn"}
          </Link>
          <Typography
          component="h1"
          variant="h2"
          align="left"
          gutterBottom
          >
            Kysely 2
          </Typography>
          <Typography variant ="h6"
          gutterBottom>
            Linkki toiseen kyselyyn
          </Typography>
  </Box>
  );
}

export default Etusivu;
